import com.sun.media.audio.AudioSystem;
import javax.sound.sampled.*;
import java.io.File;
import java.util.ArrayList;
import java.util.List;

public class AudioBlender {
    private static final int SAMPLE_RATE = 44100;
    private List<BufferedSample> samples = new ArrayList<>();

    public void loadSamples(String[] filenames) throws Exception {
        for (String filename : filenames) {
            File file = new File(filename);
            AudioInputStream stream = AudioSystem.getAudioInputStream(file);
            AudioFormat format = stream.getFormat();
            DataLine.Info info = new DataLine.Info(SourceDataLine.class, format);
            SourceDataLine line = (SourceDataLine) AudioSystem.getLine(info);
            line.open(format);
            line.start();

            byte[] data = new byte[line.getBufferSize()];
            int numBytesRead = 0;
            while ((numBytesRead = stream.read(data)) != -1) {
                line.write(data, 0, numBytesRead);
            }

            line.drain();
            line.stop();
            line.close();
            stream.close();

            ByteArrayOutputStream outputStream = new ByteArrayOutputStream();
            line.getDataLines().nextElement().transferTo(outputStream);
            byte[] sampleData = outputStream.toByteArray();
            BufferedSample sample = new BufferedSample(sampleData, format.getFrameSize(), format.getFrameRate());
            samples.add(sample);
        }
    }
}
