% Read input image
input_image = imread('image.jpg');

% Convert to grayscale and Gaussian filter (with sigma=1)
gray_image = rgb2gray(input_image);
gaussian_image = fspecial('gaussian', [5 5], 1);
filtered_image = imfilter(gray_image, gaussian_image, 'replicate');

% Define Sobel operators in x and y directions
sobel_x = [-1 0 1; -2 0 2; -1 0 1];
sobel_y = [-1 -2 -1; 0 0 0; 1 2 1];

% Apply Sobel operators to filtered image
edge_image_x = conv2(double(filtered_image), sobel_x, 'same');
edge_image_y = conv2(double(filtered_image), sobel_y, 'same');

