void bubbleSort(int arr[], int n) {
    bool swapped; // Flag to keep track of whether any swaps were made
    for (int i = 0; i < n-1; i++) {
        swapped = false; // Initialize flag as false
        for (int j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) { // Swap elements if current is greater than next
                int temp = arr[j];
                arr[j] = arr[j+1];
