function getNestedValues(obj, keyPath) {
  let currentObj = obj;
  const keys = keyPath.split(".");
  const values = [];

  for (let I = 0; I < keys.length; i++) {
    const key = keys[i];

    if (!currentObj.hasOwnProperty(key)) {
      return values; // Early exit if we reach a non-existing key
    }

    if (i === keys.length - 1) {
      // If this is the last key, add its value to the list
      values.push(currentObj[key]);
    } else if (typeof currentObj[key] === "object" && !Array.isArray(currentObj[key])) {
      // Recursively call the function with the nested object
      currentObj = currentObj[key];
    }
  }

  return values;
}

