function randomizeArray(arr) {
  const randomizedArr = [...arr]; // create a copy of the input array

  for (let I = 0; I < arr.length; i++) {
    const { position, randomize } = arr[i];

    if (!randomize) {
      randomizedArr[position - 1] = arr[i]; // keep items in their original positions
    } else {
      const randomIndex = Math.floor(Math.random() * randomizedArr.length);
      randomizedArr.splice(randomIndex, 0, arr[i]); // insert item at random position
    }
  }

  return randomizedArr;
}

