In recent years, national security has become a major concern for many countries around the world, as they strive to protect their citizens and prevent threats to their societies. In Hong Kong, this issue has taken center stage following the implementation of the National Security Law (NSL) in June 2020. This law aims to combat activities that endanger national security, including secession, subversion, terrorism, and collusion with foreign forces. One of the key provisions of the NSL is the decryption obligation, which requires individuals and organizations to provide access to encrypted data upon request by law enforcement agencies. In this essay, we will examine the decryption obligations under the NSL and analyze its implications for privacy, cybersecurity, and human rights.

Background

Before delving into the decryption obligations, it is essential to understand the context in which they operate. The NSL is a sweeping piece of legislation that fundamentally alters the legal landscape of Hong Kong. It introduces new offenses, expands existing ones, and empowers authorities to take more intrusive measures against suspected wrongdoers. Some of the notable features of the NSL include:

- Expanding the definition of secession to include acts that undermine the territorial integrity of China or Hong Kong;
- Broadening the scope of subversion to cover actions that challenge the authority of the central government or the HKSAR;
- Criminalizing collusion with foreign forces to endanger national security;
- Creating new offenses related to terrorism and incitement;
- Enabling law enforcement agencies to search premises and seize items without warrants;
- Authorizing the freezing of assets and the detention of suspects without trial.

These provisions have attracted widespread criticism from civil society groups, legal experts, and foreign governments, who argue that they violate fundamental rights and liberties guaranteed by the Hong Kong Basic Law and international human rights treaties. Despite these concerns, the Hong Kong government defends the NSL as necessary to maintain social stability and safeguard national security.

