# Define a key function for sorting
def item_key(item):
    first, second = item['first'], item['second']

    # Sort by negative values first
    if first < 0:
        return (first, second)

    # Sort by positive values next
    elif first > 0:
        return (first, second)

    # For zero values, prioritize smaller second values
    else:
        return (second, first)

# Call sort() and pass the key function
items.sort(key=item_key)

print(items)
