Sure! Here's an implementation of binary search in C++:

```cpp
// Function to perform binary search on a sorted array
int binarySearch(int arr[], int left, int right, int x) {
    while (left <= right) {
        int mid = left + (right - left) / 2;

        // Check if x is present at mid
        if (arr[mid] == x)
            return mid;

        // If x greater, ignore left half
        if (arr[mid] < x)
            left = mid + 1;

        // If x is smaller, ignore right half
        else
            right = mid - 1;
    }

    // if we reach here, then element was not present
    return -1;
}

int main() {
    int arr[] = { 2, 5, 7, 10, 14 };
    int n = sizeof(arr) / sizeof(arr[0]);
    int x = 10;
    int result = binarySearch(arr, 0, n - 1, x);
    (result == -1) ? cout << "Element is not present in array" : cout << "Element is present at index " << result;
    return 0;
}
```

Let's go through this code step by step:

1. The `binarySearch` function takes four arguments: the sorted array `arr`, the starting index `left`, the ending index `right`, and the value to be searched `x`.
2. We maintain two pointers `left` and `right` initially set to starting and ending indices respectively.
3. In each iteration, we calculate the middle index `mid` as the average of `left` and `right`.
4. If the middle element is equal to the search key `x`, we return its index `mid`.
5. If the middle element is less than the search key `x`, it means the key lies in the right half of the array, so we update the `left` pointer to `mid+1`.
6. If the middle element is greater than the search key `x`, it means the key lies in the left half of the array, so we update the `right` pointer to `mid-1`.

